/* ONE dark UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.git-plus .error {
  color: #e2c08d;
}
.git-plus .success {
  color: #73c990;
}
.git-plus .atom-panel.modal.from-bottom {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
atom-text-editor .meta.diff.range.unified,
atom-text-editor::shadow .meta.diff.range.unified {
  color: #6494ed;
}
atom-text-editor .meta.diff.header,
atom-text-editor::shadow .meta.diff.header {
  color: #6494ed;
}
atom-text-editor .markup.deleted.diff,
atom-text-editor::shadow .markup.deleted.diff {
  color: #ff6347;
}
atom-text-editor .markup.inserted.diff,
atom-text-editor::shadow .markup.inserted.diff {
  color: #73c990;
}
